	(4018450359,'Advantage Chiropractic','advantage-chiropractic-4018450359','advantagechiro.net','1999','At Advantage Chiropractic we are dedicated to providing the best and newest technology to our community. We also know that the feet are the foundation of the entire spinal pelvic structure. We also know any fallen arches or misalignment in the feet can cause pain or dysfunction in the knees, hips, back or neck. Many low back issues are actually the result of feet that are poorly supported and now we can detect if this is your case within a few minutes. Our new technology is a foot scanner that allows us to examine the three arches in each foot. It is important to understand that all pelvic stabilizer\'s we offer at Advantage Chiropractic are custom-made to support all three arches of the foot, which creates a balanced foundation. This means that no matter which stabilizer you choose, you\'ll get optimal results to satisfy you. By stabilizing and balancing your feet, custom pelvic stabilizer\'s enhance your body\'s performance and efficiency, reduce pain, and contribute to your total body wellness. Our pelvic stabilizer\'s complement your healthcare treatment here at Advantage Chiropractic when you stand, walk, and live your active life. Call today and ask us how you could have a well balanced foundation!','#100','32 32nd Ave. South','Saint Cloud','MN','56301','United States','MEDICAL_PRACTICE','Chiropractor',NULL,'Spell Capital Partners LLC',NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,X'',0,0,0,0,NULL,0,NULL,NULL,0,5,5,939000,5,NULL,NULL,187800,0.318273272,42681.81818,-0.838103448,-0.827586207,NULL,X'',X'',0,0,NULL,X'');
