	(4018450368,'Admiral Fitzroy Inn','admiral-fitzroy-inn-4018450368','admiralfitzroy.com','1984','Located in Newport, Rhode Island, the Admiral Fitzroy Inn offers rooms decorated and furnished in a distinctive fashion to please the eye and lift the spirits. Stroll along our cobblestone streets or oceanfront walks; shop in our quaint wharf areas and shopping markets; revel in the magnificence of our world famous Gilded Age mansions; feast on our fine cuisine where dining is truly a tradition, especially lobster. Newport, Rhode Island is globally known as the site of such activities as the Newport Jazz Festival, the Newport Music Festival, the legendary International Tennis Hall of Fame and the America\'s Cup races. Our legacy has always been based on the waters that surround the destination. Here, avid sailors can test their yachtsmanship on a 12-meter, a sloop, or even one of the legendary 120-foot \"J\" boats. Newport is one of the nation\'s most scenic areas for cyclists. Winding lanes along the world famous Ocean Drive leads you past magnificent mansions, old country stores, a bird sanctuary, fanciful topiary gardens, wineries, and tiny fishing coves. Newport is a city of \"firsts\" and \"oldest,\" including Touro Synagogue (the oldest Temple in the U.S.); the oldest Tavern; the oldest newspaper; the site of the first international polo match; site of the first national lawn tennis championships and the first national golf championships... and the list goes on. Hospitality has always been part of our heritage, so it is natural for us to extend it as part of what makes the destination a truly world-class place to visit.',NULL,'398 Thames St.','Newport','RI','2840','United States','Hospitality','2-Star Hotel',NULL,'Gemini Investors','Lodging & Resorts; Hospitality',NULL,NULL,NULL,NULL,0,'721110; 721','7011; 701',NULL,'FitzroyInn',NULL,NULL,X'',1,1,0,0,NULL,0,NULL,NULL,2,3,5,1679000,9,NULL,NULL,186555.5556,0.408091006,45378.37838,-0.773108108,-0.756756757,NULL,X'',X'