	(4018509989,'Abbott Properties LLC','abbott-properties-llc-4018509989','abbottproperties.com','1980','Abbott Properties is a small, but dynamic agency located in Warwick, Rhode Island. We are community oriented organization who attributes 90% of our business to referrals! Abbott Properties has been helping the community for 25 years in selling, buying, leasing and renting property, however, our community services are not merely confined to real estate; we are active in many charitable events and organizations throughout the state of Rhode Island, including The March of Dimes Walk-a-thon and Habitat for Humanity. Not only are we involved, but we also help sponsor these organizations and events. At Abbott Properties, we believe that knowing the community first begins with serving the community. When looking to buy or sell property it\'s important to select an agency that will give you the information and guidance that you need to make the right decisions. Our knowledgeable agents are trained in customer service and regularly attend seminars to keep up to date with a changing industry and economy. If your enthusiastic, motivated, a self starter, and work well with people then there may be an opportunity for you at Abbott Properties. We are looking for people either licensed, or willing to become licensed, in the the state of Rhode Island. You must have excellent interpersonal skills and be willing to do what it takes to make all parties in a transaction satisfied. If you meet these qualifications please fax your resume to 401-732-1246, Attention Don Morash.',NULL,'380 Jefferson Blvd. #B','Warwick','RI','2886','United States','Real Estate','Real Estate Agency',NULL,'The Courtney Group Incorporated','Real Estate',NULL,NULL,NULL,NULL,0,'531; 5312','6531; 653',NULL,'donmor','https://www.linkedin.com/company/abbott-properties',NULL,X'',1,1,0,0,1,0,NULL,NULL,3,3,6,5447000,21,NULL,NULL,259000,0.067511228,133000,-0.17469697,-0.363636364,NULL,X'',X'',0,0,NULL,X''),
