	(4018509991,'AAIS Corporation','aais-corporation-4018509991','aaiscorp.com','1986','AAIS Corp. is an Environmental remediation company, which is equipped to handle asbestos, lead, mold abatement and selective demolition. Incorporated in 1986, AAIS has become one of New England\'s largest independently owned abatement companies. During that time we have successfully completed over 15,000 remediation projects ranging in price from $2,500.00 to $6,000,000.00. Our customers include state and municipal governments, schools (k-12), universities, developers and major contractors (References supplied upon request). AAIS Corp. is called whenever a client has an asbestos problem or issue. From asbestos floor tile, to window caulking to asbestos pipe insulation AAIS has removed it all. AAIS is often asked to isolate abatement areas from occupied areas to allow customers to continue their normal business activities. We are a Union Company employing laborers from local 455. All of our Union workers are EPA trained and hold a current License for the State of CT. AAIS is also fully licensed by the State of CT: Asbestos License # 000017, Lead License # 000271. We have two full time licensed asbestos project designers and one licensed asbestos inspector on our staff. We are also fully insured and bonded. AAIS\'s staff of professionals have just one goal- Customer Satisfaction. Our project managers have 75 years (combined) abatement experience. Please give us a call to see if we can help you with your remediation concerns.',NULL,'P.O. Box 26066','West Haven','CT','6516','United States',NULL,'Demolition Contractor',NULL,'Gemini Investors','Commercial & Residential Construction; Construction',NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,'DenverAsbestos','https://www.linkedin.com/company/aais-corp',NULL,X'',1,1,1,1,0,0,NULL,NULL,4,2,6,1341000,6,NULL,NULL,224000,1.116029786,38300,-0.521071429,-0.571428571,NULL,X'',X'',0,0,NULL,X''),
