	(8,'backend_django.tasks.sendEmail','[[{\"message\": \"\\n                    *** This is an automatically generated message.***\\n\\n                    Contact Request Sender Information:\\n\\n                    Name: Josh\\n                    Email Address: Joshimexpert@gmail.com\\n                    Purpose: General Inquiry\\n                    Message: Hello,\\r\\n\\r\\nI am Josh and I Have 10+ years of experience in Internet Marketing & Search Engine Optimization field. My specialties are:\\r\\n\\r\\n\\u2022 Keyword Analysis: Researching the best keywords on 3 major factors Relevancy, Popularity and Compositeness.\\r\\n\\r\\n\\u2022 On-Page Optimization: Meta Tags Optimization, Mapping of landing Pages, Page Headings, Page Content Optimization, Image Optimization, Hyperlink Optimization, New Service Page Creation, XML Sitemap Creation & Submission, Robots File Creation/Optimization\\r\\n\\r\\n\\u2022 Off Page Optimization: Directory Submissions, Blog Creation & Posting, Social Bookmarking, Business Profile Listing, Video Submission, Press Release Promotion, Article Promotion, Blog Commenting, Forum Postings, Classified Submissions, Local Marketing, Image Sharing, Document Sharing, RSS Feed Submissions, Info graphic Submissions\\r\\n\\r\\n\\u2022 Social Media Marketing: Create/update and designs FaceBook Fanpage along with programming tabs and twitter profile for creating awareness and generate leads.\\r\\n\\r\\n\\u2022 Paid Marketing: Create/setup/manage Google Adwords, FaceBook and LinkedIn paid marketing campaigns.\\r\\n\\r\\n\\u2022 Web Analytics: Generation & Analysis of traffic report using Google Analytics Tool to understand the effectiveness of the keywords being used and to measure the usefulness of the off-page optimization strategies, Goal setting & measuring conversions.\\r\\n\\r\\nSpecialties: SEO, Search Engine Optimization, SEM, Search Engine Marketing, Internet Marketing, Online Marketing, Social Media Marketing, SMM\\r\\nI can show you vis