	(18,'backend_django.tasks.sendEmail','[[{\"message\": \"\\n                    *** This is an automatically generated message.***\\n\\n                    Contact Request Sender Information:\\n\\n                    Name: Andrea Peterson\\n                    Email Address: asp1@iu.edu\\n                    Purpose: General Inquiry\\n                    Message: Hello Kona Equity Team,\\r\\n\\r\\nMy name is Andrea Peterson, and I am a Junior majoring in Finance and Business Analytics in the Kelley School of Business at Indiana University. I am reaching out to the Kona Equity to inquire about potential internship positions that the firm may offer as I am highly interested in Private Equity and Venture Capital after my pervious internship this past summer. I am a driven college student looking to add value to a private equity firm for the months of December 2020 \\u2013 January 2021 as I will be living in Kona with some of my family in the area. I initiated coverage on software companies, generating financial models for deal execution and General Partner investments and upgraded business operations for portfolio companies, resulting in internal processes and communication efficiencies increased.\\r\\n\\r\\nFurthermore, my equity research knowledge stems from being an analyst in the Consumer Staples Sector for the Knall-Cohen Fund, a management course that actively manages a real financial portfolio.  The course has cultivated my curiosity for market research as it requires advanced and detailed equity investigation.  My team and I are prepared a presentation on the opportunity costs for investing in Tyson Foods Inc.  In this, I leveraged my relationship-building skills within the team to drive us to impactful decisions, finding that working under pressure is both stimulating and fulfilling.  I would relish the opportunity to see how these same skills could be of significance in adding value to the Principal\\u2019s and Vice President\\u2019s daily responsibilities. \\r\\n\\r\\nAfter exploring the company, I was inspired by Kona Equity\\u2019s data driven emphasis on revenue, growth, employees, and technologies to help businesses see tomorrow\\u2019s opportunities, today.  Thank you for considering my place for this internship opportunity. Please contact me at (765) 865-7426 or at asp1@iu.edu.\\r\\n\\r\\nSincerely,\\r\\nAndrea Peterson\\n                \", \"subject\": \"Contact request by Andrea Peterson (asp1@iu.edu) for General Inquiry\"}], {}]','e3c21f24f7ff4e77e918fdcb24813634ea1820c6',NULL,0,'2020-11-23 18:39:08.312396',0,NULL,'email',1,NULL,'','182831','2020-11-23 18:39:07.038876',NULL,NULL),
