	(26,'backend_django.tasks.sendEmail','[[{\"message\": \"\\n                    *** This is an automatically generated message.***\\n\\n                    Contact Request Sender Information:\\n\\n                    Name: Nick Arora\\n                    Email Address: nick@scrollnext.com\\n                    Purpose: General Inquiry\\n                    Message: Hi,\\r\\n\\r\\nMy name is Nick, SEO expert with 11+ years of experience, worked on 100s of websites, bring so many start-ups on the top in Google. I have experience working for all GEOs specifically US/UK/AUS based websites.\\r\\n\\r\\nMy core skills are in SEO/Social media/ PPC/ reputation management. I have done Product management and handled a team of 60+ members. My total experience is more than 11 years. I can place the site at top in Google and help generating heavy traffic on your site. And that too in just 45 to 90 days time.\\r\\n\\r\\nMy strategies are aligned with Google\\u2019s Humming Bird / PENGUIN and PANDA update.\\r\\n\\r\\nI have worked with Big Brands like:-\\r\\n\\r\\nUPI.com (having more than 65,000 unique visits everyday)\\r\\nhttp://glx.com/ (having more than 10,000 unique visits everyday)\\r\\nWizIQ.com (Online marketplace for teachers and students with virtual classroom tool)\\r\\n\\r\\nMy current project has 2.3 million visits per month with:\\r\\n\\r\\nVisit to lead conversion rate: over 20%\\r\\nLead to customer conversion: over 8%\\r\\nAverage revenue per month: $225,000\\r\\n\\r\\nI have gone through your website https://www.konaequity.com/ in detail. I can get your website ranked on the top in Google in just 45 to 90 days time. \\r\\n\\r\\nServices incorporate into my SEO campaigns includes: \\r\\n\\r\\nOn Page Optimization: \\r\\n\\r\\nKeyword Analysis & Research\\r\\nBaseline Keyword Ranking Report\\r\\nXML Sitemap\\r\\nRobots.txt\\r\\nGoogle Webmaster Tools Setup & Verification\\r\\nYahoo Webmaster Tools Setup & Verification\\r\\nBing Webmaster Tools Setup & Verification\\r\\nGoogle Engine Submissions\\r\\nGoogle Analytic Setup\\r\\nMeta Tags Optimization\\r\\nGoogle Business Listing (Google Map & reviews)\\r\\nWebsite design optimization recommendations\\r\\nWebsite content optimization recommendations\\r\\n\\r\\nOff-page optimization:\\r\\nPresentation sharing channels by creating Presentations\\r\\nArticle sites using articles\\r\\nBlogs posting\\r\\nBlog commenting\\r\\nForums\\r\\nImage sharing\\r\\nBusiness directories\\r\\nLocal listings\\r\\nYahoo question answers\\r\\nBookmarking these activities\\r\\nOthers..\\r\\n\\r\\n\\r\\nI can timely report you and updates you about the tasks finished and my next step to optimize your website. I will be available on Skype/Google Hangout/Emails for more than 16 hours a day. \\r\\n\\r\\nPlease let me if you have any queries, so that we can schedule a call or communicate via emails. Looking forward to hear from you soon. \\r\\n\\r\\n\\r\\nThanks and Regards,\\r\\nNick\\r\\nSkype: nick@scrollnext.com\\n                \", \"subject\": \"Contact request by Nick Arora (nick@scrollnext.com) for General Inquiry\"}], {}]','853dfcec878d8c1a7381776b8270ea373db4a8b9',NULL,0,'2021-02-04 03:43:33.627155',0,NULL,'email',5,'2021-02-04 03:43:33.624132','Traceback (most recent call last):\n  File \"/home/Konaequity/.virtualenvs/kona/lib/python3.6/site-packages/background_task/tasks.py\", line 43, in bg_runner\n    func(*args, **kwargs)\n  File \"/home/Konaequity/django_react/backend_django/tasks.py\", line 19, in sendEmail\n    fail_silently = False,\n  File \"/home/Konaequity/.virtualenvs/kona/lib/python3.6/site-packages/django/core/mail/__init__.py\", line 60, in send_mail\n    return mail.send()\n  File \"/home/Konaequity/.virtualenvs/kona/lib/python3.6/site-packages/django/core/mail/message.py\", line 284, in send\n    return self.get_connection(fail_silently).send_messages([self])\n  File \"/home/Konaequity/.virtualenvs/kona/lib/python3.6/site-packages/django/core/mail/backends/smtp.py\", line 10