etrics.comhttps://www.madhouseinc.com/https://www.hairlosslearningcenter.org/\\u00a0http://dominohelp.com/\\u00a0http://moonshine-ide.com/\\u00a0I\'m organized, straightforward, and most importantly, I know how tocommunicate sincerely with people from diverse backgrounds. I can provideconsulting, software development, testing/debugging and other services rangingfrom short one-hour jobs to full-time everyday work to long-term cooperation andsupport.\\u00a0Let\\u2019s have a conversation to get more details about my relevantexperience or provide info about your needs! Always open and capable to learnquickly new frameworks and technologies used in your projects!\\u00a0I am available on Skype/hangouts forcommunication more than 16 hours a day. Here are my communication details:\\u00a0Skype- nicksanman@gmail.comHangouts- nick.arora@scrollnext.com\\u00a0Looking forward to hearing from yousoon.\\u00a0Regards,Nick\\n                \", \"subject\": \"Contact request by Nick Arora (nick.arora@scrollnext.com) for General Inquiry\"}], {}]','0b1253994b80db2466d013f01834e3e936081808',NULL,0,'2021-04-29 12:00:16.504777',0,NULL,'email',1,NULL,'','31','2021-04-29 12:00:14.603197',NULL,NULL),
