	(52,'backend_django.tasks.sendEmail','[[{\"message\": \"\\n                    *** This is an automatically generated message.***\\n\\n                    Contact Request Sender Information:\\n\\n                    Name: Will Freeman\\n                    Email Address: will@inunisonbrands.com\\n                    Purpose: General Inquiry\\n                    Message: Hi. I\'ve been trying to search through your automotive database. I love the info but the site often doesn\'t work - goes to some error message about Python. Just FYI.\\r\\n\\r\\nAnyways, I\'m interested in learning about auto companies that sell at least partly online. Is there any filter I can use to get rid of just regular brick and mortar mechanics and dealerships and the like?\\r\\n\\r\\nThanks,\\r\\n\\r\\nWill Freeman\\n                \", \"subject\": \"Contact request by Will Freeman (will@inunisonbrands.com) for General Inquiry\"}], {}]','1367265f37d513c7601b931e4c3f57d3ab0292e7',NULL,0,'2021-06-16 20:15:50.074923',0,NULL,'email',1,NULL,'','31','2021-06-16 20:15:49.156040',NULL,NULL),
	(53,'backend_django.tasks.sendEmail','[[{\"message\": \"\\n                    *** This is an automatically generated message.***\\n\\n                    Contact Request Sender Information:\\n\\n                    Name: Courtney Rosenfeld\\n                    Email Address: courtneyrosenfeld@gigspark.biz\\n                    Purpose: General Inquiry\\n                    Message: Hi!\\r\\n\\r\\nI\\u2019m so excited by the rise in \\u201csolopreneurs\\u201d like me! It\\u2019s been incredibly rewarding to grow my side gig into a full-time pursuit.\\r\\n\\r\\nStill, I\\u2019ve learned that solopreneurs don\\u2019t have to do it completely on their own. Working with freelancers and the right software helps offload certain tasks so solopreneurs have time to focus on more important business matters.\\r\\n\\r\\nOn that note: Can I write an article for you to use on your site that offers helpful tips for solopreneurs on the kinds of freelance and tech-based help that can boost their businesses? With everything going on right now, I think a lot of people are exploring their options for starting their own business, so it could really help your readers.\\r\\n\\r\\nLet me know what you think, and thanks in advance!\\r\\n\\r\\nThanks!\\r\\nCourtney\\r\\n\\r\\nCourtney Rosenfeld :: gigspark.biz\\n                \", \"subject\": \"Contact request by Courtney Rosenfeld (courtneyrosenfeld@gigspark.biz) for General Inquiry\"}], {}]','4b9714e6a8116e3d77dd21553858bb6c18dd206a',NULL,0,'2021-06-17 04:32:17.845512',0,NULL,'email',1,NULL,'','31','2021-06-17 04:32:16.256475',NULL,NULL),
